import { Link } from 'react-router-dom';

const Banner = () => (
  <div className="banner">
    <h3 className="navlinks">
      <Link to="/">Posts</Link>
      </h3>
      <h3 className="navlinks">
      <Link to="/contact">Contact</Link>
      </h3>
  </div>
);

export default Banner;
